35 \u0434\u0435\">\u0425\u043e\u0441\u0435 \u0434\u0435 \u0421\u0430\u043d-\u041c\u0430\u0440\u0442\u0438\u043d\u0430<\/a>, \u0440\u0430\u0437\u0431\u0438\u043b\u0430 \u0438\u0441\u043f\u0430\u043d\u0446\u0435\u0432 \u0432 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_San_Lorenzo\" class=\"extiw\" title=\"en:Battle of San Lorenzo\">\u0431\u0438\u0442\u0432\u0435 \u043f\u043e\u0434 \u0421\u0430\u043d-\u041b\u043e\u0440\u0435\u043d\u0446\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830\" class=\"mw-redirect\" title=\"1830\">1830<\/a>&#160;\u2014 \u0422\u0440\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B5_%D0%B4%D0%B5%D1%80%D0%B6%D0%B0%D0%B2%D1%8B\" class=\"mw-redirect\" title=\"\u0412\u0435\u043b\u0438\u043a\u0438\u0435 \u0434\u0435\u0440\u0436\u0430\u0432\u044b\">\u0432\u0435\u043b\u0438\u043a\u0438\u0435 \u0434\u0435\u0440\u0436\u0430\u0432\u044b<\/a>\u00bb \u0415\u0432\u0440\u043e\u043f\u044b&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a>, \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%82%D0%BE%D0%BA%D0%BE%D0%BB_1830_%D0%B3%D0%BE%D0%B4%D0%B0\" class=\"mw-redirect\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b 1830 \u0433\u043e\u0434\u0430\">\u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b<\/a>, \u043f\u0440\u0438\u0437\u043d\u0430\u0432 \u0442\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u0438<\/a> \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1852\" class=\"mw-redirect\" title=\"1852\">1852<\/a>&#160;\u2014 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Uruguayan_Civil_War\" class=\"extiw\" title=\"en:Uruguayan Civil War\">\u0423\u0440\u0443\u0433\u0432\u0430\u0439\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0431\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u043e<\/a>-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%9A%D0%BE%D0%BB%D0%BE%D1%80%D0%B0%D0%B4%D0%BE_(%D0%A3%D1%80%D1%83%D0%B3%D0%B2%D0%B0%D0%B9)\" title=\"\u041f\u0430\u0440\u0442\u0438\u044f \u041a\u043e\u043b\u043e\u0440\u0430\u0434\u043e (\u0423\u0440\u0443\u0433\u0432\u0430\u0439)\">\u0443\u0440\u0443\u0433\u0432\u0430\u0439\u0441\u043a\u0430\u044f<\/a> \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u044f \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0430 \u043f\u043e\u0431\u0435\u0434\u0443 \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B3%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%84%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f\">\u0430\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u043e\u0439<\/a> \u0430\u0440\u043c\u0438\u0435\u0439 \u0432 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Caseros\" class=\"extiw\" title=\"en:Battle of Caseros\">\u0431\u0438\u0442\u0432\u0435 \u043f\u043e\u0434 \u041a\u0430\u0441\u0435\u0440\u043e\u0441\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867\" class=\"mw-redirect\" title=\"1867\">1867<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%86%D1%83%D1%85%D0%B8%D1%82%D0%BE\" class=\"mw-redirect\" title=\"\u041c\u0443\u0446\u0443\u0445\u0438\u0442\u043e\">\u041c\u0443\u0446\u0443\u0445\u0438\u0442\u043e<\/a> \u0441\u0442\u0430\u043b \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%9C%D1%8D%D0%B9%D0%B4%D0%B7%D0%B8\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u041c\u044d\u0439\u0434\u0437\u0438\">\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u041c\u044d\u0439\u0434\u0437\u0438<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870\" class=\"mw-redirect\" title=\"1870\">1870<\/a>&#160;\u2014 \u0412\u0441\u0442\u0443\u043f\u0438\u043b\u0430 \u0432 \u0441\u0438\u043b\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%8F%D1%82%D0%BD%D0%B0%D0%B4%D1%86%D0%B0%D1%82%D0%B0%D1%8F_%D0%BF%D0%BE%D0%BF%D1%80%D0%B0%D0%B2%D0%BA%D0%B0_%D0%BA_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D0%B8_%D0%A1%D0%A8%D0%90\" title=\"\u041f\u044f\u0442\u043d\u0430\u0434\u0446\u0430\u0442\u0430\u044f \u043f\u043e\u043f\u0440\u0430\u0432\u043a\u0430 \u043a \u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 \u0421\u0428\u0410\">15 \u043f\u043e\u043f\u0440\u0430\u0432\u043a\u0430<\/a> \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%A1%D0%A8%D0%90\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u0421\u0428\u0410\">\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 \u0421\u0428\u0410<\/a>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043f\u0440\u044f\u043c\u043e \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u043b\u0430 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BA%D1%82%D0%B8%D0%B2%D0%BD%D0%BE%D0%B5_%D0%B8%D0%B7%D0%B1%D0%B8%D1%80%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE\" title=\"\u0410\u043a\u0442\u0438\u0432\u043d\u043e\u0435 \u0438\u0437\u0431\u0438\u0440\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e\">\u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u0438\u0437\u0431\u0438\u0440\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0430<\/a> \u043f\u043e \u043f\u0440\u0438\u0437\u043d\u0430\u043a\u0443 \u0440\u0430\u0441\u044b, \u0446\u0432\u0435\u0442\u0430 \u043a\u043e\u0436\u0438 \u0438\u043b\u0438 \u0432 \u0