ps:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE_%D0%A8%D0%B8_%D0%9C%D0%B8%D0%BD\" title=\"\u0425\u043e \u0428\u0438 \u041c\u0438\u043d\">\u0425\u043e \u0428\u0438 \u041c\u0438\u043d\u043e\u043c<\/a> \u0438 \u0434\u0440\u0443\u0433\u0438\u043c\u0438 \u044d\u043c\u0438\u0433\u0440\u0430\u043d\u0442\u0430\u043c\u0438 \u0432 \u041a\u0438\u0442\u0430\u0435 \u043d\u0430 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BD%D0%BA%D0%BE%D0%BD%D0%B3\" title=\"\u0413\u043e\u043d\u043a\u043e\u043d\u0433\">\u0413\u043e\u043d\u043a\u043e\u043d\u0433\u0435<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC%D0%B0\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430\">\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430<\/a>, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044f \u0418\u043d\u0434\u043e\u043a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u0438 \u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u0410\u043d\u043d\u0430\u043c\u0430, \u0430 \u0442\u0430\u043a\u0436\u0435 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0447\u043b\u0435\u043d\u043e\u0432 \u0418\u043d\u0434\u043e\u043a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043b\u0438\u0433\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1931\" class=\"mw-redirect\" title=\"1931\">1931<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D0%B5%D1%82%D1%80%D1%8F%D1%81%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B2_%D0%A5%D0%BE%D0%BA%D1%81-%D0%91%D0%B5%D0%B9\" title=\"\u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u0432 \u0425\u043e\u043a\u0441-\u0411\u0435\u0439\">\u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u0432 \u0425\u043e\u043a\u0441-\u0411\u0435\u0439<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2_(%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043e\u0441\u0442\u0440\u043e\u0432 (\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u044f)\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u043c \u043e\u0441\u0442\u0440\u043e\u0432\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0432\u043e\u0439 \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u0432 10:47 \u0443\u0442\u0440\u0430 \u043f\u043e \u043c\u0435\u0441\u0442\u043d\u043e\u043c\u0443 \u0432\u0440\u0435\u043c\u0435\u043d\u0438. \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u044f \u043f\u043e\u0433\u0438\u0431\u043b\u043e 256 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u0430 \u0440\u0435\u0433\u0438\u043e\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D0%BA%D1%81-%D0%91%D0%B5%D0%B9\" title=\"\u0425\u043e\u043a\u0441-\u0411\u0435\u0439\">\u0425\u043e\u043a\u0441-\u0411\u0435\u0439<\/a> \u0431\u044b\u043b \u043d\u0430\u043d\u0435\u0441\u0451\u043d \u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u0449\u0435\u0440\u0431. \u041d\u0430 \u043a\u043e\u043d\u0435\u0446 2012 \u0433\u043e\u0434\u0430 \u044d\u0442\u043e \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u043e\u0441\u0442\u0430\u0432\u0430\u043b\u043e\u0441\u044c \u0441\u0430\u043c\u044b\u043c \u0441\u043c\u0435\u0440\u0442\u043e\u043d\u043e\u0441\u043d\u044b\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B8%D1%85%D0%B8%D0%B9%D0%BD%D0%BE%D0%B5_%D0%B1%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%B8%D0%B5\" title=\"\u0421\u0442\u0438\u0445\u0438\u0439\u043d\u043e\u0435 \u0431\u0435\u0434\u0441\u0442\u0432\u0438\u0435\">\u0441\u0442\u0438\u0445\u0438\u0439\u043d\u044b\u043c \u0431\u0435\u0434\u0441\u0442\u0432\u0438\u0435\u043c<\/a> \u0432 \u041d\u043e\u0432\u043e\u0439 \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939\" class=\"mw-redirect\" title=\"1939\">1939<\/a>&#160;\u2014 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BA%D1%80%D0%B5%D1%89%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D1%81%D1%82%D1%80%D0%B5%D0%BB%D1%8B\" class=\"mw-redirect\" title=\"\u0421\u043a\u0440\u0435\u0449\u0451\u043d\u043d\u044b\u0435 \u0441\u0442\u0440\u0435\u043b\u044b\">\u0421\u043a\u0440\u0435\u0449\u0451\u043d\u043d\u044b\u0435 \u0441\u0442\u0440\u0435\u043b\u044b<\/a>\u00bb \u0432\u0437\u043e\u0440\u0432\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B0%D1%8F_%D1%81%D0%B8%D0%BD%D0%B0%D0%B3%D0%BE%D0%B3%D0%B0_(%D0%91%D1%83%D0%B4%D0%B0%D0%BF%D0%B5%D1%88%D1%82)\" title=\"\u0411\u043e\u043b\u044c\u0448\u0430\u044f \u0441\u0438\u043d\u0430\u0433\u043e\u0433\u0430 (\u0411\u0443\u0434\u0430\u043f\u0435\u0448\u0442)\">\u0411\u043e\u043b\u044c\u0448\u0443\u044e \u0441\u0438\u043d\u0430\u0433\u043e\u0433\u0443<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%B4%D0%B0%D0%BF%D0%B5%D1%88%D1%82\" title=\"\u0411\u0443\u0434\u0430\u043f\u0435\u0448\u0442\">\u0411\u0443\u0434\u0430\u043f\u0435\u0448\u0442\u0435<\/a>.<\/li><\/ul> <ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943\" class=\"mw-redirect\" title=\"1943\">1943<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u0432\u044b\u0441\u0430\u0434\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%81%D0%B0%D0%BD%D1%82\" title=\"\u0414\u0435\u0441\u0430\u043d\u0442\">\u0434\u0435\u0441\u0430\u043d\u0442\u0430<\/a> \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%A6%D0%B5%D0%B7%D0%B0%D1%80%D1%8C_%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0443\u043d\u0438\u043a\u043e\u0432, \u0426\u0435\u0437\u0430\u0440\u044c \u041b\u044c\u0432\u043e\u0432\u0438\u0447\">\u0426\u0435\u0437\u0430\u0440\u044f \u041a\u0443\u043d\u0438\u043a\u043e\u0432\u0430<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BB%D0%B0%D1%8F_%D0%B7%D0%B5%D0%BC%D0%BB%D1%8F\" title=\"\u041c\u0430\u043b\u0430\u044f \u0437\u0435\u043c\u043b\u044f\">\u041c\u0430\u043b\u0443\u044e \u0417\u0435\u043c\u043b\u044e<\/a> (\u0433. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%BE%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA\" title=\"\u041d\u043e\u0432\u043e\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\">\u041d\u043e\u0432\u043e\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a<\/a>). \u0411\u043e\u0438 \u0434\u043b\u0438\u043b\u0438\u0441\u044c 225 \u0434\u043d\u0435\u0439, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0433\u043e\u0440\u043e\u0434 \u0431\u044b\u043b \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D0%BC%D0%B0%D1%85%D1%82\" title=\"\u0412\u0435\u0440\u043c\u0430\u0445\u0442\">\u043d\u0435\u043c\u0435\u0446\u043a\u0438\u043c \u0432\u043e\u0439\u0441\u043a\u0430\u043c<\/a> \u0431\u044b\u043b \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442 \u043f\u0443\u0442\u044c \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7\" title=\"\u041a\u0430\u0432\u043a\u0430\u0437\">\u041a\u0430\u0432\u043a\u0430\u0437<\/a>.&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442 \u00ab<a href=\"https:\/\/en.wikipedia.org\/wiki\/USAT_Dorchester\" class=\"extiw\" title=\"en:USAT Dorchester\">USAT Dorchester<\/a>\u00bb \u0431\u044b\u043b \u043f\u043e\u0442\u043e\u043f\u043b\u0435\u043d \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u0439 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u0439 \u043b\u043e\u0434\u043a\u043e\u0439. \u0421\u043f\u0430\u0441\u043b\u0438\u0441\u044c 230 \u0438\u0437 902 \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0438\u0445\u0441\u044f \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043b\u044e\u0434\u0435\u0439. \u0413\u0435\u0440\u043e\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043f\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0447\u0435\u0442\u044b\u0440\u0451\u0445 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u043e\u0432 (\u043c\u0435\u0442\u043e\u0434\u0438\u0441\u0442, \u0440\u0430\u0432\u0432\u0438\u043d, \u043a\u0430\u0442\u043e\u043b\u0438\u043a \u0438 \u0440\u0435\u0444\u043e\u0440\u043c\u0438\u0441\u0442) \u043f\u0440\u0438\u0432\u0435\u043b\u043e \u043a \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D1%83%D0%BC%D1%8D%D0%BD,_%D0%93%D0%B0%D1%80%D1%80%D0%B8\" title=\"\u0422\u0440\u0443\u043c\u044d\u043d, \u0413\u0430\u0440\u0440\u0438\">\u0413\u0430\u0440\u0440\u0438 \u0422\u0440\u0443\u043c\u044d\u043d\u043e\u043c<\/a> \u0434\u043d\u044f \u043f\u0430\u043c\u044f\u0442\u0438 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Four_Chaplains\" class=\"extiw\" title=\"en:Four Chaplains\">\u0447\u0435\u0442\u044b\u0440\u0451\u0445 \u043a\u0430\u043f\u0435\u043b\u043b\u0430\u043d\u043e\u0432<\/a> \u0438 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044e \u00ab<a href=\"https:\/\/en.wikipedia.org\/wiki\/Four_Chaplains%27_Medal\" class=\"extiw\" title=\"en:Four Chaplains' Medal\">\u041c\u0435\u0434\u0430\u043b\u0438 \u0427\u0435\u0442\u044b\u0440\u0451\u0445 \u041a\u0430\u043f\u0435\u043b\u0430\u043d\u043e\u0432<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944\" class=\"mw-redirect\" title=\"1944\">1944<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%BE-%D0%9D%D0%BE%D0%B2%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_(1944)\" class=\"mw-redirect\" title=\"\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e-\u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f (1944)\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e-\u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a>: \u0412\u043e\u0439\u0441\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/2-%D1%8F_%D1%83%D0%B4%D0%B0%D1%80%D0%BD%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" title=\"2-\u044f \u0443\u0434\u0430\u0440\u043d\u0430\u044f \u0430\u0440\u043c\u0438\u044f\">2-\u0439 \u0443\u0434\u0430\u0440\u043d\u043e\u0439 \u0430\u0440\u043c\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82\" title=\"\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u0438\u0439 \u0444\u0440\u043e\u043d\u0442\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0433\u043e \u0444\u0440\u043e\u043d\u0442\u0430<\/a> \u0432\u044b\u0448\u043b\u0438 \u043d\u0430 \u0440\u0435\u043a\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%80%D0%B2%D0%B0_(%D1%80%D0%B5%D0%BA%D0%B0)\" title=\"\u041d\u0430\u0440\u0432\u0430 (\u0440\u0435\u043a\u0430)\">\u041d\u0430\u0440\u0432\u0443<\/a>, \u0444\u043e\u0440\u0441\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u0435\u0451, \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b\u0438 \u0434\u0432\u0430 \u043f\u043b\u0430\u0446\u0434\u0430\u0440\u043c\u0430 \u043d\u0430 \u0435\u0451 \u043b\u0435\u0432\u043e\u043c \u0431\u0435\u0440\u0435\u0433\u0443 \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%80%D0%B2%D0%B0\" title=\"\u041d\u0430\u0440\u0432\u0430\">\u041d\u0430\u0440\u0432\u0430<\/a> \u0438 \u043d\u0430\u0447\u0430\u043b\u0438 \u0431\u043e\u0438 \u0437\u0430 \u0438\u0445 \u0440\u0430\u0441\u0448\u0438\u0440\u0435\u043d\u0438\u0435. \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0432\u0441\u0442\u0443\u043f\u0438\u043b\u0438 \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%81%D1%82%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u042d\u0441\u0442\u043e\u043d\u0441\u043a\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u042d\u0441\u0442\u043e\u043d\u0441\u043a\u043e\u0439 \u0421\u0421\u0420<\/a>.&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%BE%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D1%8B%D1%85_%D0%B4%D0%B5%D0%B9%D1%81%D1%82%D0%B2%D0%B8%D0%B9_%D0%92%D1%82%D0%BE%D1%80%D0%BE%D0%B9_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\" title=\"\u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u0412\u0442\u043e\u0440\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b\">\u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u0412\u0442\u043e\u0440\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BB%D0%B1%D0%B5%D1%80%D1%82%D0%B0-%D0%9C%D0%B0%D1%80%D1%88%D0%B0%D0%BB%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0438\u043b\u0431\u0435\u0440\u0442\u0430-\u041c\u0430\u0440\u0448\u0430\u043b\u043b\u043e\u0432\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u0413\u0438\u043b\u0431\u0435\u0440\u0442\u0430-\u041c\u0430\u0440\u0448\u0430\u043b\u043b\u043e\u0432\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a>: \u043f\u043e\u0431\u0435\u0434\u043e\u0439 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u0435\u0432 \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Kwajalein\" class=\"extiw\" title=\"en:Battle of Kwajalein\">\u0431\u0438\u0442\u0432\u0430 \u0437\u0430 \u041a\u0432\u0430\u0434\u0436\u0435\u043b\u0435\u0439\u043d<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945\" class=\"mw-redirect\" title=\"1945\">1945<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%81%D0%BB%D0%BE-%D0%9E%D0%B4%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0438\u0441\u043b\u043e-\u041e\u0434\u0435\u0440\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u0412\u0438\u0441\u043b\u043e-\u041e\u0434\u0435\u0440\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1-%D0%B9_%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82\" title=\"1-\u0439 \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0444\u0440\u043e\u043d\u0442\">1-\u0433\u043e \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e<\/a> (\u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0438\u0439&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D1%88%D0%B0%D0%BB_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u041c\u0430\u0440\u0448\u0430\u043b \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u043c\u0430\u0440\u0448\u0430\u043b \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D1%83%D0%BA%D0%BE%D0%B2,_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B9_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0416\u0443\u043a\u043e\u0432, \u0413\u0435\u043e\u0440\u0433\u0438\u0439 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u0432\u0438\u0447\">\u0413\u0435\u043e\u0440\u0433\u0438\u0439 \u0416\u0443\u043a\u043e\u0432<\/a>) \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1-%D0%B9_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82\" title=\"1-\u0439 \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \u0444\u0440\u043e\u043d\u0442\">1-\u0433\u043e \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e<\/a> \u0444\u0440\u043e\u043d\u0442\u043e\u0432 (\u043c\u0430\u0440\u0448\u0430\u043b \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%B5%D0%B2,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u043e\u043d\u0435\u0432, \u0418\u0432\u0430\u043d \u0421\u0442\u0435\u043f\u0430\u043d\u043e\u0432\u0438\u0447\">\u0418\u0432\u0430\u043d \u041a\u043e\u043d\u0435\u0432<\/a>), \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0432\u0448\u0430\u044f \u0441 12 \u044f\u043d\u0432\u0430\u0440\u044f \u043f\u043e 3 \u0444\u0435\u0432\u0440\u0430\u043b\u044f 1945&#160;\u0433.&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u0438\u0441\u044c \u0431\u043e\u0435\u0432\u044b\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1-%D0%B9_%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82\" title=\"1-\u0439 \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0444\u0440\u043e\u043d\u0442\">1-\u0433\u043e \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u0444\u0440\u043e\u043d\u0442\u0430<\/a> \u043f\u043e \u0443\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u044e \u0438 \u0440\u0430\u0441\u0448\u0438\u0440\u0435\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%8E%D1%81%D1%82%D1%80%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BB%D0%B0%D1%86%D0%B4%D0%B0%D1%80%D0%BC\" title=\"\u041a\u044e\u0441\u0442\u0440\u0438\u043d\u0441\u043a\u0438\u0439 \u043f\u043b\u0430\u0446\u0434\u0430\u0440\u043c\">\u043f\u043b\u0430\u0446\u0434\u0430\u0440\u043c\u0430<\/a> \u043d\u0430 \u0440\u0435\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%B5%D1%80\" class=\"mw-redirect\" title=\"\u041e\u0434\u0435\u0440\">\u041e\u0434\u0435\u0440<\/a> \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%8E%D1%81%D1%82%D1%80%D0%B8%D0%BD\" class=\"mw-redirect\" title=\"\u041a\u044e\u0441\u0442\u0440\u0438\u043d\">\u041a\u044e\u0441\u0442\u0440\u0438\u043d<\/a>, \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u0432\u0448\u0438\u0435\u0441\u044f \u0434\u043e 30 \u043c\u0430\u0440\u0442\u0430 1945 \u0433\u043e\u0434\u0430.&#160;\u2014 \u041f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0443\u0437\u043d\u0438\u043a\u043e\u0432 20-\u0433\u043e \u0431\u043b\u043e\u043a\u0430 \u0432 \u043a\u043e\u043d\u0446\u0435\u043d\u0442\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u043e\u043c \u043b\u0430\u0433\u0435\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%83%D1%82%D1%85%D0%B0%D1%83%D0%B7%D0%B5%D0%BD_(%D0%BA%D0%BE%D0%BD%D1%86%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BB%D0%B0%D0%B3%D0%B5%D1%80%D1%8C)\" title=\"\u041c\u0430\u0443\u0442\u0445\u0430\u0443\u0437\u0435\u043d (\u043a\u043e\u043d\u0446\u0435\u043d\u0442\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u043b\u0430\u0433\u0435\u0440\u044c)\">\u041c\u0430\u0443\u0442\u0445\u0430\u0443\u0437\u0435\u043d<\/a>.&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%BE%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D1%8B%D1%85_%D0%B4%D0%B5%D0%B9%D1%81%D1%82%D0%B2%D0%B8%D0%B9_%D0%92%D1%82%D0%BE%D1%80%D0%BE%D0%B9_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\" title=\"\u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u0412\u0442\u043e\u0440\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b\">\u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u0412\u0442\u043e\u0440\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>: \u041d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Manila_(1945)\" class=\"extiw\" title=\"en:Battle of Manila (1945)\">\u0431\u0438\u0442\u0432\u0430 \u0437\u0430 \u041c\u0430\u043d\u0438\u043b\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950\" class=\"mw-redirect\" title=\"1950\">1950<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9C%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D0%B8%D1%8F_%D0%B2_%D0%91%D0%B5%D0%BB%D0%BE%D1%81%D1%82%D0%BE%D0%BA%D0%B5&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0430\u044f \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0432 \u0411\u0435\u043b\u043e\u0441\u0442\u043e\u043a\u0435 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\